import { createApp } from 'vue'
import App from './App.vue'
import Quasar from 'quasar/src/vue-plugin.js';import Notify from 'quasar/src/plugins/notify/Notify.js';import useQuasar from 'quasar/src/composables/use-quasar/use-quasar.js';
import quasarUserOptions from './quasar-user-options'
import { createPinia } from 'pinia'

const $q = useQuasar();
const pinia = createPinia()

createApp(App).use(Quasar, quasarUserOptions).use(pinia).use(Notify).mount('#app')
